window.bookSummaryJSON = "<p><b>\"Prepare to be scandalized by the hottest shooting star in the universe…\"</b></p> <p>Stella is a rising star in her intergalactic troupe. Focused on her blooming career, she never expected to be blindsided by one handsome alien, let alone two.</p> <p>Prince Zin and Chancellor Toras are determined to win their dazzling human over, even if they have to put their differences aside. The two sexy space hunks will do anything for Stella. Worship her, seduce her, charm her—and protect her from the mysterious poison spreading through the troupe.</p> <p>A fateful encounter leads to an unforgettable cosmic kiss that puts this trio in the spotlight of love. Will Stella, Zin, and Toras follow their hearts and shoot for the stars?</p> <p>Cosmic Kiss <i>is book one in the Galactic Gems series of interconnected standalones. Each book features a different performer finding their alien love, spicy scenes, and lots of romance with a dash of mystery.</i></p>"; 
